È il caso in cui una riga di una tabella si associa ad una ed una sola riga di un'altra tabella. Questo tipo di relazione si ha di solito quando abbiamo una tabella di dettagli. Pensiamo ad esempio ad un'applicazione in cui salviamo nei database i dettagli di un utente. create table utenti ( utente_id int primary key auto_increment, nome varchar(100), cognome varchar(100),
);
create table dettagli_utente ( utente_id int, indirizzo varchar(100), telefono varchar(30), foreign key(utente_id) references utenti(utente_id)
); In questo caso, ogni dettaglio si riferisce ad uno ed un solo utente, ed ogni utente ha uno es un solo dettaglio. Per interrogare il database: select u.cognome,d.indirizzo
from dettagli_utente as d
join utenti as u using(utente_id); Da notare che in questa select ho usato using anziché on perché le colonne con la chiave esterna e la chiave primaria avevano lo stesso nome (utente_id). Qualcuno potrebbe pensare che la tabella dettagli_utente potrebbe essere fusa con la tabella utenti, cioè potremmo semplicemente aggiungere le colonne indirizzo e telefono ad utenti. Ottima osservazione! In effetti, alcune volte conviene farlo, altre volte no. Bisogna prendere in considerazione: quanto spesso utilizzo i dettagli: se li uso raramente, conviene tenerli in una tabella separata quanto sono grandi le tabelle: se la tabelle sono grandi, conviene tenerle separate se hanno privilegi di accesso diversi: se la tabella dettagli ha dei vincoli di accesso più stringenti (ad esempio perché contiene dei dati sensibili), conviene tenerli in una tabella separata.

