E' il caso in cui una riga di una tabella può avere un riferimento da più righe di un'altra tabella. Pensiamo al caso degli eventi e dell'organizzatore dell'evento. Ogni evento, ha uno ed un solo utente organizzatore, mentre un utente può organizzare vari eventi. create table utenti ( utente_id int primary key auto_increment, nome varchar(100), cognome varchar(100),
)
create table eventi ( evento_id int primary key auto_increment, titolo varchar(100), organizzatore int, foreign key(organizzatore) references utenti(utente_id)
) Interrogazione: select e.titolo,u.cognome
from eventi as e
join utenti as u on e.organizzatore=u.utente_id;

