È il caso in cui una riga di una tabella può riferirsi a più righe di un'altra tabella e viceversa. Pensiamo ad esempio al caso dei partecipanti ad un evento. Ogni evento può avere più eventi partecipanti, ed ogni utente può partecipare a più eventi. Non esiste in SQL un modo semplice di esprimere questa relazione. Per sua natura infatti, ogni colonna può avere solo un valore, non è possibile mettere una lista di valori all'interno della colonna. In teoria si potrebbe avere una colonna varchar con all'interno più valori, ad esempio più numeri di telefono separati da virgola. Questa sarebbe una convenzione personale dello sviluppatore, non qualcosa di gestito nativamente dal database, ed è fortemente sconsigliato. In ogni caso, quando un database non ha effettivamente colonne con più valori, si dice che è in prima forma normale . Per rappresentare una relazione molti a molti dobbiamo necessariamente usare una nuova tabella, che conterrà solo chiavi esterne che fanno riferimento alle tabelle che devono essere associate. Questa tabella prende il nome di tabella associativa (junction table). create table utenti ( utente_id int primary key auto_increment, nome varchar(100), cognome varchar(100),
);
create table eventi ( evento_id int primary key auto_increment, titolo varchar(100),
);
create table partecipanti ( evento_id int, utente_id int, foreign key(evento_id) references eventi(evento_id), foreign key(utente_id) references utenti(utente_id),
); A questo punto, per poter fare un'interrogazione, dovrò mettere due join concatenate: select e.titolo, u.nome as nome_partecipante, u.cognome as cognome_partecipanti
from partecipanti as p
join eventi as e using(evento_id)
join utenti as u using (utente_id);

